const initialState = {
  state: [],
};

const pokemonsListReducer = (state, action) => {
  switch (action.type) {
    case "LIMIT": {
      console.log("8", state);
      return true;
    }

    default:
      return state;
  }
};

export default pokemonsListReducer;
